[[File:Muddy key detail.png|left|110px]]
The '''muddy key''' is a key that can be used to open the [[Muddy chest]] in the centre of the [[Lava Maze]] in the [[Wilderness]]. You will need a knife or sword to access it. It can be obtained as a drop from [[Chaos dwarf|Chaos dwarves]] and the [[Crazy archaeologist]]. It is similar in appearance to the [[crystal key]].

{{Clear|left}}

==Loot==
At current prices, the loot from one key is worth {{NoCoins|{{#vardefineecho:lootval|{{#expr:{{GEP|Uncut ruby}}+{{GEP|Mithril bar}}+{{GEP|Mithril dagger}}+{{GEP|Anchovy pizza}}+{{GEP|Law rune|2}}+{{GEP|Death rune|2}}+{{GEP|Chaos rune|10}}}}}}}} coins, and a net profit of {{NoCoins|{{#var:lootval}}-{{GEP|Muddy key}}}} coins.

Assuming you have at most 1 other item in your inventory and want to keep all the loot, you can take 6 keys to end up with full inventory of loot. (6*4 + 3 = 27) If you discard/alch the daggers, you can take 8 keys. (8*3 + 3 = 27)
